{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"22942"},"a":"Thread","hasPost":{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"41502"},"a":"Post","dateCreated":"2014-12-09T15:59:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Washington and Alaska","featureValue":"Washington and Alaska"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"Researcher","featureValue":"Researcher"},"uri":"http://dig.isi.edu/atf/data/post/7AB2D57518795B2E9D6BB99F144C60DE1240701E/featurecollection"},"hasBodyPart":{"text":"It has been reported on the L.C. Smith Collectors Association forum that noted\ndouble gun historian and collector, and long time Remington Society member\nAndy Anderson passed away Monday. Andy was a great guy, always willing to\nshare his knowledge of these New York made doubles, both Remington and L.C.\nSmith. Andy's jovial nature will be greatly missed.\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Sad Day","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/7AB2D57518795B2E9D6BB99F144C60DE1240701E"},"hasTitlePart":{"text":"Sad Day","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/thread/01C0CE16382062F561B0C8FE199EDA4F938C4F68"}
{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"112016"},"a":"Thread","hasPost":{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"998919"},"a":"Post","dateCreated":"2013-06-24T17:03:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Everywhere","featureValue":"Everywhere"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"Rice","featureValue":"Rice"},"uri":"http://dig.isi.edu/atf/data/post/F437994CED150695E2ED25CCD5C2FC75624DCF84/featurecollection"},"hasBodyPart":{"text":"Have some canons in the classifieds\n\n \n_________________ \nA man who won't has no advantage over the man who can't.\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Classified","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/F437994CED150695E2ED25CCD5C2FC75624DCF84"},"hasTitlePart":{"text":"Classified","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/thread/091043133836AFD7B46C151B58B2811C45E78F5B"}
{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"29"},"a":"Thread","hasPost":[{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"3220"},"a":"Post","dateCreated":"2012-06-22T09:12:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Uhrichsville ,Ohio","featureValue":"Uhrichsville ,Ohio"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"JerryL944","featureValue":"JerryL944"},"uri":"http://dig.isi.edu/atf/data/post/CE74694492781BE2D30E94D971F343A8C5801004/featurecollection"},"hasBodyPart":{"text":"Hi All \n \nI do a lot of reloading Hand gun calibers and now just .223 . But when I had a\n30/30 - 303 Brit SMLE Mk 4 - a 308 - and 30 carbine I used to reload them . \n \nI mostly use all jacketed bullets . But now that I have The big boy in .45\nColt I want a 51/2 in to 6 in single action western style gun ??? I don't\nquite what to get ??? ( Ruger -Colt - Uberti - ) As for the frame /grip style\nI will have to go hold and try the various styles . \n \nNot sure what feels right and what the advantages are one style over the other\n. \n \nJerry 944\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Re: What cartridges do you reload?","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/CE74694492781BE2D30E94D971F343A8C5801004"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"3316"},"a":"Post","dateCreated":"2012-07-15T11:24:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"10 AC","featureValue":"10 AC"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"Ambush.22","featureValue":"Ambush.22"},"uri":"http://dig.isi.edu/atf/data/post/8E0A4607FCA3FD5894960A44F4B0310CBD051566/featurecollection"},"hasBodyPart":{"text":"\n\nHey Jerry, I have two Rugers in 45 colt. One is a Vaquero, and the other is a\nconvertible Blackhawk. And i was lucky enough that the .45acp cylinder will\nwork in my Vaquero as well. As I do reload the .45 acp, so that is what I\nshoot mostly out of them right now. I love them both pretty equally, now I\nneed a lever gun in that caliber. I don't reload for it yet, but that is one\nof the next die sets that I will be getting. That and a set for my .223's. \nBut I guess i do love those Ruger revlovers, as of now I own a little over a\nhalf a dozen.\n\n \n_________________ \n[http://i115.photobucket.com/albums/n316 ...\n_holes.gif](http://i115.photobucket.com/albums/n316/wiuprof/Bullet_holes.gif)\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Re: What cartridges do you reload?","a":"WebPageElement"},"hasImagePart":{"a":"ImageObject","uri":"http://dig.isi.edu/atf/data/image/176AAACC361DCA2B12F3C308039779A3DFD11F78"},"uri":"http://dig.isi.edu/atf/data/post/8E0A4607FCA3FD5894960A44F4B0310CBD051566"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"3351"},"a":"Post","dateCreated":"2012-07-20T21:01:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Uhrichsville ,Ohio","featureValue":"Uhrichsville ,Ohio"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"JerryL944","featureValue":"JerryL944"},"uri":"http://dig.isi.edu/atf/data/post/CA68E2AF3043C7DE0D02BF176CBF019EE506D46E/featurecollection"},"hasBodyPart":{"text":"\n\nHi Ambush.22 \n \nWell I ended up with a New Ruger Bisley 45 Colt Blued and wood grips with a 7\n1/2 in barrel Shoots great I am using AA#5 at 10.5 grains with .225 and 250\ngrain jacketed . \n \nI don't have a chronograph But I think that puts them at about 950 -1000 FPS I\nalso am using the same load for my Henry Big Boy . \n \nI would still like to get a 5 1/2 in I think ??? in .45 Colt \n \nNeed to get a gun belt and some western holsters ..... \n \nJerry 944\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Re: What cartridges do you reload?","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/CA68E2AF3043C7DE0D02BF176CBF019EE506D46E"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"3229"},"a":"Post","dateCreated":"2012-06-24T01:36:00","hasFeatureCollection":{"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":".Dirty-.Thirty","featureValue":".Dirty-.Thirty"},"uri":"http://dig.isi.edu/atf/data/post/FBAF9F9BBDA94C1100AE5FAC4ED73B5363FBC113/featurecollection"},"hasBodyPart":{"text":"\n\nAdd me for another, getting ready to order my dies and supplies for\n.357magnum. Howdy Jerry, I have a Ruger single action and think they are a\nfine pistola. You might want to give one of those a serious look in a model\nthat suits your tastes and geel for it. .DT\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Re: What cartridges do you reload?","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/FBAF9F9BBDA94C1100AE5FAC4ED73B5363FBC113"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"3550"},"a":"Post","dateCreated":"2012-11-04T14:00:00","hasFeatureCollection":{"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"223fan","featureValue":"223fan"},"uri":"http://dig.isi.edu/atf/data/post/5E05CA559173B1365B534A5AEFE3C1C295AFBDA2/featurecollection"},"hasBodyPart":{"text":"\n\nI currently load 223,270,30-06 & 357mag.I have loaded for 22\nhornet,222,22-250,308,444,45-70,44mag,45colt & 9mm.I have been reloading and\ncasting bullets sense 1992.\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Re: What cartridges do you reload?","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/5E05CA559173B1365B534A5AEFE3C1C295AFBDA2"}],"hasTitlePart":{"text":"What cartridges do you reload?","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/thread/09188D003AC72676CFBFF7AC616398B7FD4D3ED7"}
