ntext.json","hasIdentifier":{"a":"Identifier","label":"323"},"a":"Post","dateCreated":"2013-02-21T17:26:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Bozeman","featureValue":"Bozeman"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"Molon_Labe","featureValue":"Molon_Labe"},"uri":"http://dig.isi.edu/atf/data/post/964274C54551DAD8957AD0307855A51416206835/featurecollection"},"hasBodyPart":{"text":"\n\nBack on up! Will trade these too.\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Re: FS/FT: XPS2-0 and Red Dot","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/964274C54551DAD8957AD0307855A51416206835"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"5"},"a":"Post","dateCreated":"2013-02-12T21:46:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Bozeman","featureValue":"Bozeman"},"memex:pricesMentioned_feature":{"featureName":"prices_mentioned","memex:pricesMentioned":"120","a":"Feature","featureValue":"120"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"Molon_Labe","featureValue":"Molon_Labe"},"uri":"http://dig.isi.edu/atf/data/post/F64C75804E467656847BD87AE43498A52D285E68/featurecollection"},"hasBodyPart":{"text":"\n\nIJK Optics sight designed like the EOTech XPS2-0. 10/10 condition. Still have\nthe box, manuals, etc. $120\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"FS/FT: XPS2-0","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/F64C75804E467656847BD87AE43498A52D285E68"}],"hasTitlePart":{"text":"FS/FT: XPS2-0","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/thread/09F0F6EAE4E602237641F85BB07A0D99A2A31939"}
{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"5837"},"a":"Thread","hasPost":[{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"71073"},"a":"Post","dateCreated":"2015-02-21T23:02:00","hasFeatureCollection":{"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"SHOOTINIT","featureValue":"SHOOTINIT"},"uri":"http://dig.isi.edu/atf/data/post/773FE4FFEF20469CE65B3A4E2C117EACF48D8B0C/featurecollection"},"hasBodyPart":{"text":"\n\ndepends what the molly is suspended in....the one up top is suspended in a\npetroleum base..\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Re: Moly grease","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/773FE4FFEF20469CE65B3A4E2C117EACF48D8B0C"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"34787"},"a":"Post","dateCreated":"2013-03-31T15:37:00","hasFeatureCollection":{"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"markasaurus","featureValue":"markasaurus"},"uri":"http://dig.isi.edu/atf/data/post/3DB57A40437DEFF479DB9D30989E5A4C3C42AECD/featurecollection"},"hasBodyPart":{"text":"\n\nIs it the regular automotive Molly grease for wheel bearings etc. or is it\nhigher Molly content?? \nMoly grease for air guns is a higher percentage of moly to the carrier\nsubstance.\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Re: Moly grease","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/3DB57A40437DEFF479DB9D30989E5A4C3C42AECD"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"34788"},"a":"Post","dateCreated":"2013-03-31T16:15:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Between San Francisco and Sacramento by Jelly Belly and Budweiser","featureValue":"Between San Francisco and Sacramento by Jelly Belly and Budweiser"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"Barnydaddy","featureValue":"Barnydaddy"},"uri":"http://dig.isi.edu/atf/data/post/209E460A5D263D3C9CDF847FEA2D1C54271DBF9B/featurecollection"},"hasBodyPart":{"text":"\n\nDo not! \nDo not! \nUse this stuff on any airgun. \nIt is for balljoints on your car. \nUSE THIS STUFF: \n<http://www.airgunwarehouseinc.com/py-a-3498.html> \nDo not use oil-based lubricant of any kind on any air rifle.\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Re: Moly grease","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/209E460A5D263D3C9CDF847FEA2D1C54271DBF9B"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"34141"},"a":"Post","dateCreated":"2013-03-19T09:52:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Newman Lake, Washington State, USA","featureValue":"Newman Lake, Washington State, USA"},"memex:pricesMentioned_feature":[{"featureName":"prices_mentioned","memex:pricesMentioned":"13","a":"Feature","featureValue":"13"},{"featureName":"prices_mentioned","memex:pricesMentioned":"7.50","a":"Feature","featureValue":"7.50"}],"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"SteveK1953","featureValue":"SteveK1953"},"uri":"http://dig.isi.edu/atf/data/post/0162C72A388128EBF7900207E7BF09F55961D1E3/featurecollection"},"hasBodyPart":{"text":"Hello gents, \nThis is my first post to the forum after much enjoyable reading. Just wanted\nto say greetings and give a link to a better price on the moly grease used on\nthe Marauder. If purchased from the suppliers online one can pay $13 for 1oz.\nAt Napa you can buy the same item for $7.50, 9ozs. \"three 3oz tubes\" , have it\nnow, no waiting, no shipping costs and have enough to split with your buddies. \n \n<http://www.napaonline.com/Catalog/CatalogItemDetail.aspx?R=SLRSL3144_00064101\n03> \n \nSteveK \nNewman Lake, WA\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Moly grease","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/0162C72A388128EBF7900207E7BF09F55961D1E3"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"71071"},"a":"Post","dateCreated":"2015-02-21T20:41:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Palmyra PA","featureValue":"Palmyra PA"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"kc3ak","featureValue":"kc3ak"},"uri":"http://dig.isi.edu/atf/data/post/843306D8C3F5003429036570A339D18144C27E37/featurecollection"},"hasBodyPart":{"text":"\n\nI know this is an old thread, but I'm new and just received my m-rod 25 and\nhave a question. I have 2 squeeze bottles of dry powder molly. Can that be\nused where the molly grease is used? It sort of seems to me that if you want a\nvery light coating and then burnished coat of molly grease, a light dusting of\npowder molly and burnishing would do about the same thing. If not, what have I\nmissed? Thanks for any insight that you might give. \n \nTerry\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Re: Moly grease","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/843306D8C3F5003429036570A339D18144C27E37"}],"hasTitlePart":{"text":"Moly grease","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/thread/0AF8CE7EDD84EDA725169470C953463F1754D723"}
{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"13346"},"a":"Thread","hasPost":[{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"380406"},"a":"Post","dateCreated":"2013-12-17T14:13:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Louisville","featureValue":"Louisville"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"DDgunslinger","featureValue":"DDgunslinger"},"uri":"http://dig.isi.edu/atf/data/post/6F70F7CDA2759637D155A35524324AB4F6F3BF12/featurecollection"},"hasBodyPart":{"text":"\n\nThese are our projected dates for the upcoming year. There may be changes as\nthe year progresses, but this is tentatively what this years training will\nlook like. Everything is scheduled for one day, but depending on class size\nthe level 2 & 3's could get bumped to two days. We hope to see you all out on\nthe range. \n \nJan 18th - CCDW \nJan 19th - Tactical Pistol lvl 1 \nFeb 16th - Tactical Rifle lvl 1 \nMar 8th - Tactical Pistol lvl 2 \nMar 30th - Art of EDC \nApr 19th - Tactical Rifle lvl 2 \nMay 24th - CCDW \nMay 25th - Tactical Pistol lvl 1 \nJun 15th - Tactical Rifle lvl 1 \nJun 28th - Tactical Pistol lvl 2 \nJul 12th - Tactical Rifle lvl 3 \nAug 9th - CCDW \nAug 10th - Tactical Pistol lvl 1 \nAug 31st - Tactical Rifle lvl 1 \nSep 13th - Tactical Pistol lvl 2 \nOct 26th - Apocalypse Shoot \nNov 8th - CCDW \nNov 9th - Art of EDC \nNov 22nd - Tactical Rifle lvl 3 \nDec 14th - Xmas Shoot\n\n \n_________________ \n![Image](http://i932.photobucket.com/albums/ad165/msprague86/9EB82CD1-5B4B-\n46B8-8179-D962522ED05F-14318-000009675D8A9051.jpg) \n**Real World** Training for **Real World** Situations, for all your tactical training needs check out **RWI Tactical** at <http://www.kyfirearmstraining.com>\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"RWI Tactical 2014 Training Calendar","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/6F70F7CDA2759637D155A35524324AB4F6F3BF12"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"381045"},"a":"Post","dateCreated":"2013-12-18T16:13:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"The Twilight Zone","featureValue":"The Twilight Zone"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"dbh","featureValue":"dbh"},"uri":"http://dig.isi.edu/atf/data/post/8850441CBB04998CED3D0300B139997FC4AA8A82/featurecollection"},"hasBodyPart":{"text":"\n\nWill one of the FF or Mods please pin this ?\n\n \n_________________ \n![Image](http://i1172.photobucket.com/albums/r565/dbhaupt69/DBH.jpg)\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"RWI Tactical 2014 Training Calendar","a":"WebPageElement"},"hasImagePart":{"a":"ImageObject","uri":"http://dig.isi.edu/atf/data/image/E8B35F38CFA2E7AE0643DBE8A3A7053FF6F4FB80"},"uri":"http://dig.isi.edu/atf/data/post/8850441CBB04998CED3D0300B139997FC4AA8A82"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"380427"},"a":"Post","dateCreated":"2013-12-17T15:05:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Bullitt County","featureValue":"Bullitt County"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"mtchbrian","featureValue":"mtchbrian"},"uri":"http://dig.isi.edu/atf/data/post/508FF1C7C59589A82D3345A7C3140D9D369D82A2/featurecollection"},"hasBodyPart":{"text":"\n\nsweet training on my bday\n\n \n_________________ \nProud husband, father of 2, Iraqi Freedom Veteran, and Operation New Dawn\nveteran. \n![Image](http://i487.photobucket.com/albums/rr234/mtchbrian/Brian.jpg) \nRWI Tactical - For the best in Kentucky Firearms Training.\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"RWI Tactical 2014 Training Calendar","a":"WebPageElement"},"hasImagePart":{"a":"ImageObject","uri":"http://dig.isi.edu/atf/data/image/FD1FC7F26F21139B21A0829CF4B94CF91412CB58"},"uri":"http://dig.isi.edu/atf/data/post/508FF1C7C59589A82D3345A7C3140D9D369D82A2"}],"hasTitlePart":{"text":"RWI Tactical 2014 Training Calendar","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/thread/1A1E6A5CDBBDAF0715714BF3132A373BB864A8DD"}
