{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"1779"},"a":"Thread","hasPost":{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"14898"},"a":"Post","dateCreated":"2013-11-09T10:00:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"LaGrange Georgia","featureValue":"LaGrange Georgia"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"donhuff","featureValue":"donhuff"},"uri":"http://dig.isi.edu/atf/data/post/6649322F299C4A7F4986348FE6B1F96BACCB3D26/featurecollection"},"hasBodyPart":{"text":"\n\nShot my 45-70 Rio some yesterday. I needed to empty some brass so that I could\nload up some of my new powder coated slugs for testing. \n \nFirst off was some 405s with 8.5g 800X. I think that if I was a smoker, I\ncould pull the trigger and light one up and get half way through with it\nbefore the bullet hit the steel at 100 yds, like BOOM..........ting. Then\nafter about 20 or so, I switched to the same slug but with 38.0 IMR 4198\n![:shock:](./images/smilies/icon_eek.gif) ouch, it's been a while since I shot\nit last time. I looked at the lady to my right and she had that, I can't\nbelieve you just did that, look on her face. You know the sympathetic look\nthat tells you she knows your not all there! Then I looked to my left, and the\nguy two benches down said \"now that's more like it. I felt my britches legs\nmove from the shock wave\". I looked back at the lady and stuck my tongue out.\nI think it has something to do with seeing me get knocked off the bench, and\nthe size of that big bullet that makes people think it's a BIG BOOMER, cause\nto me the guy shooting a 7 mag is a lot louder. \n \nIt was kinda odd to see all the smoke from the lube again, as I have been\nshooting the powder coated stuff lately. Almost like shooting black powder.\nBoom, wait, wait, now I see the target! One guy said \"do you load your own?\"\nyes....\"I could tell when I smelled the smoke\". Well, now not only am I stupid\nfor liking something that kicks, but I also STINK!\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"shooting the 45-70 and smoking","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/6649322F299C4A7F4986348FE6B1F96BACCB3D26"},"hasTitlePart":{"text":"shooting the 45-70 and smoking","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/thread/2A325C9450C36C59C88C480E1EBF9526EC709279"}
{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"3618"},"a":"Thread","hasPost":{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"33132"},"a":"Post","dateCreated":"2015-04-15T21:00:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"NE US","featureValue":"NE US"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"jack76590","featureValue":"jack76590"},"uri":"http://dig.isi.edu/atf/data/post/C0869EE01A434E76A50ED36963AE8F7667078973/featurecollection"},"hasBodyPart":{"text":"\n\nI put a marble tang sight on my rossi 92. Naturally had to take off existing\nrear sight. Now thinking of installing marble folding leaf rear sight as well.\nSpecifically, looking at sight linked below. I have left on existing front\nsight. So two questions. \n1.Would this work on my gun with tang sight and original equipment front\nsight? \n2\\. Sight I am looking at has .375 dovetail (3/8\"). Will this fit rossi\ndovetail as I have heard they have strange measurement? thanks \n[http://www.midwayusa.com/product/986064 ...\nuctFinding](http://www.midwayusa.com/product/986064/marbles-95-folding-\nsporting-rear-sight-rifle-style-blade-flat-top-steel-\nblue?cm_vc=ProductFinding)\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Folding leaf sight for 92 with tang sight","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/C0869EE01A434E76A50ED36963AE8F7667078973"},"hasTitlePart":{"text":"Folding leaf sight for 92 with tang sight","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/thread/2E02B6A8DE94597A608BDAB4ACBA3C8977FB761D"}
