{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"3264"},"a":"Thread","hasPost":{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"29892"},"a":"Post","dateCreated":"2014-12-20T19:00:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"MO","featureValue":"MO"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"Chiefeis","featureValue":"Chiefeis"},"uri":"http://dig.isi.edu/atf/data/post/AE8B5EC851A7E5B456D0F72FA58A1B7C5F9F7078/featurecollection"},"hasBodyPart":{"text":"\n\nI've read where some guys are modifying their CJ stocks to use speed loaders.\nBefore I went and did anything drastic, I looked at the various speedloaders\nout there. \n \nAll had one drawback for me - they were too bulky to comfortably carry. So I\ngot a couple Tuff speedstrips to try out. Got to say I like them. \n \nClearly not as fast as as a speedloader, but faster than a dump bag and easier\nto carry than either loose rounds or speedloaders. Need to do more practice\nwith them, but I think they will work great. \n \nNow if it will just warm up a little so we can hit the range again...\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Speedloaders","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/AE8B5EC851A7E5B456D0F72FA58A1B7C5F9F7078"},"hasTitlePart":{"text":"Speedloaders","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/thread/3914763F0122C4C06BE087776EA658CF797FBD7B"}
