{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"278"},"a":"Thread","hasPost":{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"1105"},"a":"Post","dateCreated":"2004-01-05T20:16:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Nashville, Tennessee","featureValue":"Nashville, Tennessee"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"johnharris","featureValue":"johnharris"},"uri":"http://dig.isi.edu/atf/data/post/14FB2FAD750AECE91C95E83C9ED60C08AA701788/featurecollection"},"hasBodyPart":{"text":"The chapter started off a little rough with On Target's misfortune before the\nsecond meeting was set. In addition, we have experienced some difficulty\nlocating TFA members who have the extra time to commit to sheparding this\nproject for the first year. \n \nIf you would be interested in stepping forward to the challenge, please\ncontact\n[JohnHarris@tennesseefirearms.com](mailto:JohnHarris@tennesseefirearms.com) or\nby PM.\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Leadership Assistance Requested","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/14FB2FAD750AECE91C95E83C9ED60C08AA701788"},"hasTitlePart":{"text":"Leadership Assistance Requested","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/thread/42A92D75951EA7B514D08ADD87F45A3155A91C7F"}
