{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"2810"},"a":"Thread","hasPost":[{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"10616"},"a":"Post","dateCreated":"2009-10-13T08:11:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Bells","featureValue":"Bells"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"C. Richard Archie","featureValue":"C. Richard Archie"},"uri":"http://dig.isi.edu/atf/data/post/F152B708DA41C16BCD3A20052303FE427854F95C/featurecollection"},"hasBodyPart":{"text":"\n\nI will get the word out in the Jackson area. \n \nI at least will be there!\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Re: First Meeting","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/F152B708DA41C16BCD3A20052303FE427854F95C"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"10613"},"a":"Post","dateCreated":"2009-10-12T21:29:00","hasFeatureCollection":{"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"Butch Butler","featureValue":"Butch Butler"},"uri":"http://dig.isi.edu/atf/data/post/005354B3A9B341FB81DED3A7297C4D36B5263C0B/featurecollection"},"hasBodyPart":{"text":"\n\nWe will have our first meeting Thursday October 29th.It will be held at Joes\nSteakhouse (former Graces).We will have spaghetti,salad,roll,and drink for 8\ndollars or you can order from the menu.We will begin eating at 5:30 with the\nmeeting starting at 7:00.The guest speaker will be State Representative Judy\nBarker.You do not have to be a Member to attend.If you plan to attend please\nlet me know so they can prepare enough food. \nThe address for the meeting (in case you use a tom tom or google map) is 3762\nkenn tn highway Union City 38261. \nButch Butler\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"First Meeting","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/005354B3A9B341FB81DED3A7297C4D36B5263C0B"}],"hasTitlePart":{"text":"First Meeting","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/thread/5F9ECDC250AA0E8773093795D3E3202C1D1AC3A2"}
{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"11480"},"a":"Thread","hasPost":[{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"75494"},"a":"Post","dateCreated":"2009-10-15T11:14:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Echo, OR","featureValue":"Echo, OR"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"jmad_81","featureValue":"jmad_81"},"uri":"http://dig.isi.edu/atf/data/post/895D7C0179BBF06985E81AEB999568A870234D05/featurecollection"},"hasBodyPart":{"text":"\n\nMy wife is right handed and left eye dominant. She had some trouble shooting\nright handed before we found out she was left eye dominant. switched her to\nshooting left handed and she improved dramatically. It took some time and alot\nof practice to get her comfertable with it, but it has been worth it. She\nstill likes shooting a right handed bolt gun better than a left handed one,\nshe just shoots it left handed.\n\n \n_________________ \nIf God wanted us to be vegetarians, he would have made broccoli more fun to\nshoot!\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"dominant eye","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/895D7C0179BBF06985E81AEB999568A870234D05"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"75466"},"a":"Post","dateCreated":"2009-10-15T07:50:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"central washington","featureValue":"central washington"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"str8meat","featureValue":"str8meat"},"uri":"http://dig.isi.edu/atf/data/post/1A22EDE82AE3A9E2DD5E799828E36E3B23155A36/featurecollection"},"hasBodyPart":{"text":"\n\ni am left eye dominant and do everything right handed. is it possible to\nchange dominant eyes? all my rifles are right handed, i shoot a bow right\nhanded, but i looked like a fool trying work a left handed action. is there\nsomething i can do to change this or just stick with whats working?\n\n \n_________________ \nsome call it hunting, i call it \"grocery shopping\"\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"dominant eye","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/1A22EDE82AE3A9E2DD5E799828E36E3B23155A36"}],"hasTitlePart":{"text":"dominant eye","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/thread/5FB0B2C7277C97F3CB1DC94E9C4EB9819D79F536"}
{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"7753"},"a":"Thread","hasPost":[{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"491625"},"a":"Post","dateCreated":"2014-12-06T19:25:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Corbin, KY","featureValue":"Corbin, KY"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"Bama","featureValue":"Bama"},"uri":"http://dig.isi.edu/atf/data/post/AA379197EF381F6A97D99DA22C63F06CF68FE2F5/featurecollection"},"hasBodyPart":{"text":"\n\nThanks for all the help. I would like a set in case I get the opportunity to\nattend a class\n\n \n_________________ \nMatthew 23:12 - And whosoever shall exalt himself shall be humbled; and\nwhosoever shall humble himself shall be exalted.\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Tactical Training Q & A","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/AA379197EF381F6A97D99DA22C63F06CF68FE2F5"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"490115"},"a":"Post","dateCreated":"2014-12-01T10:10:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Louisville","featureValue":"Louisville"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"DDgunslinger","featureValue":"DDgunslinger"},"uri":"http://dig.isi.edu/atf/data/post/7CE61597E91DF26C4F04C9D451E08B95424B4192/featurecollection"},"hasBodyPart":{"text":"ChopperDoc wrote:\n\nthese have some pretty good reviews. \n \n[http://www.amazon.com/Hatch-XTAK-Knee-P ... +knee+pads](http://www.amazon.com\n/Hatch-XTAK-Knee-Pads-Black/dp/B000SJMJUM/ref=sr_1_1?ie=UTF8&qid=1417402977&sr\n=8-1&keywords=hatch+knee+pads) \n \nlots of options on Amazon.\n\n \n \nI'm pretty sure that's what I have, mine are just an older model.\n\n \n_________________ \n![Image](http://i932.photobucket.com/albums/ad165/msprague86/9EB82CD1-5B4B-\n46B8-8179-D962522ED05F-14318-000009675D8A9051.jpg) \n**Real World** Training for **Real World** Situations, for all your tactical training needs check out **RWI Tactical** at <http://www.kyfirearmstraining.com>\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Tactical Training Q & A","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/7CE61597E91DF26C4F04C9D451E08B95424B4192"}],"hasTitlePart":{"text":"Tactical Training Q & A","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/thread/62F835186795530EA63C8CE9CF95805B50736762"}
