{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"66802"},"a":"Thread","hasPost":[{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"826581"},"a":"Post","dateCreated":"2013-06-26T19:57:00","hasFeatureCollection":{"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"dukalmighty","featureValue":"dukalmighty"},"uri":"http://dig.isi.edu/atf/data/post/B5201DC21AC2AA1C18F9FA884B513AA1A031BBA1/featurecollection"},"hasBodyPart":{"text":"\n\nI am a member of another Carry Forum,and have been for several years,the\noriginal owner only allowed 16 banners for advertising sponsors on the\nHomepage,it was agreat website with lots of good information like this\nwebsite,only on a national level.The owner sold the website about a year\nago,the New Owners turned it into a commercialized forum and about 1/2 the\nposts are buy/sell and a lot of them have nothing to do with guns or related\nequipment.It doesn't have the feeling of the close knit community it was and\nbecause of that,I will be spending my time on Texaschlforum.I hope that this\nsite never becomes just another forum somebody sees as a way to make money off\nof people sharing their knowledge and Ideas for free.Thanks Chas\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Re: Rule Reminder: The Forum is Non-commercial!","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/B5201DC21AC2AA1C18F9FA884B513AA1A031BBA1"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"853168"},"a":"Post","dateCreated":"2013-09-15T14:22:00","hasFeatureCollection":{"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"OrangeAnimal","featureValue":"OrangeAnimal"},"uri":"http://dig.isi.edu/atf/data/post/130C365FDF294E80E91907342753A189E428A68E/featurecollection"},"hasBodyPart":{"text":"\n\nI do like this site the most and appreciate the fact that it is not overrun\nwith ad's and jerks trying to message you to buy their products. Also I much\nrather deal with real people if I do want to buy something. I am still a firm\nbeliever in a man keeping his word and doing business with a handshake knowing\nthey are willing to stand behind it. So for that ability to deal with honest\npeople and hear honest reviews and opinions I thank everyone who makes this\nsite a great place.\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Re: Rule Reminder: The Forum is Non-commercial!","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/130C365FDF294E80E91907342753A189E428A68E"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"825797"},"a":"Post","dateCreated":"2013-06-24T16:36:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Pleasanton, Texas","featureValue":"Pleasanton, Texas"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"Pecos","featureValue":"Pecos"},"uri":"http://dig.isi.edu/atf/data/post/C6A0176C4A781AD067D2A09230342C610CDE824C/featurecollection"},"hasBodyPart":{"text":"Thanks Keith. Just want to be sure to follow the rules. No need to reply! I\nknow your busy. ![:biggrinjester:](./images/smilies/biggrinjester.gif)\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Re: Rule Reminder: The Forum is Non-commercial!","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/C6A0176C4A781AD067D2A09230342C610CDE824C"}],"hasTitlePart":{"text":"Rule Reminder: The Forum is Non-commercial!"