{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"19173"},"a":"Thread","hasPost":{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"172417"},"a":"Post","dateCreated":"2012-05-08T09:34:00","hasFeatureCollection":{"memex:pricesMentioned_feature":[{"featureName":"prices_mentioned","memex:pricesMentioned":"229","a":"Feature","featureValue":"229"},{"featureName":"prices_mentioned","memex:pricesMentioned":"319","a":"Feature","featureValue":"319"}],"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"NoslerMP","featureValue":"NoslerMP"},"uri":"http://dig.isi.edu/atf/data/post/D6C54E63A22753CDB26F57C4EC9FC2368FB06D0B/featurecollection"},"hasBodyPart":{"text":"![Image](https://s3.amazonaws.com/nosler-\nimages/VAR/Varmageddon_AR_Scope_03.jpg) \n![Image](https://s3.amazonaws.com/nosler-\nimages/VAR/Varmageddon_AR_Scope_02.jpg) \n![Image](https://s3.amazonaws.com/nosler-\nimages/VAR/Varmageddon_AR_Scope_01.jpg) \n \n \nNosler, long known for manufacturing some of the world\u2019s finest varmint\nbullets and ammunition has partnered up with the master AR builders at\nNoveske to unleash the new Varmageddon Signature Series AR Varmint Rifle.\nDesigned to be the ultimate varmint hunting platform, the Varmageddon AR is\nequally at home in the prairie dog towns of the plains, or calling coyotes in\nthe sagebrush. Available as rifle only for $2295 or in a complete accessory\npackage that includes a Varmageddon edition Leupold VX-3 LR 4.5-14x50 scope\nfeaturing the CDS turret calibrated to match Nosler\u2019s .223 55gr Tipped\nVarmageddon ammunition for $3195. This unprecedented collaboration between\nNosler, Noveske and Leupold takes all the work out of choosing a varmint\nhunting system. The Varmageddon AR rifle comes standard with the features\nbelow commonly found only on custom AR rifles: \n \n \n\\- 18\u201d 1:8 Twist Stainless Steel Barrel \n-5.56mm Chamber \n-Extended Feed Ramps \n-Bead blasted finish on barrel \n-1/2x28 threads w/ thread protector \n-Low Profile Gas block pinned to barrel \n-Forged Vltor MUR upper receiver featuring anti-rotation interface with handguard \n-Free floated 13.5\u201d NSR Handguard featuring the revolutionary KeyMod system \n-Shot peened and MP tested bolt \n-Auto carrier with properly staked carrier key \n-BCMGUNFIGHTER charging handle \n-Intermediate length gas system \n-Noveske Signature Back Up Iron Sight by Troy Industries \n-Forged lower with: \n-Mil-Spec receiver extension \n-Geissele SD-E Trigger \n-Magpul PRS Stock \n-Magpul MOE Grip \n \nFor more information, or to place an order, contact Shawn Finley at\n[shawnf@nosler.com](mailto:shawnf@nosler.com)\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Nosler's Varmageddon AR Rifle","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/D6C54E63A22753CDB26F57C4EC9FC2368FB06D0B"},"hasTitlePart":{"text":"Nosler's Varmageddon AR Rifle","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/thread/77BD199449EDA71578D9E4FEB2E8AD99BCE68A0F"}
{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"4494"},"a":"Thread","hasPost":{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"17059"},"a":"Post","dateCreated":"2014-09-14T15:32:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Nashville, TN","featureValue":"Nashville, TN"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"David Lewis","featureValue":"David Lewis"},"uri":"http://dig.isi.edu/atf/data/post/4809D1E01B7A61A73D19487EE6ECF7251C902CF1/featurecollection"},"hasBodyPart":{"text":"\n\nThe Nashville/Davidson County Chapter of the TFA will hold our monthly meeting\non Tuesday, 16 September. \n \nWe are meeting at Golden Corral buffet in Hermitage, just off Old Hickory\nBlvd, right behind Chick-Fil-A. \n \nOur guest speaker is Claude Morse of Project Appleseed. Project Appleseed is a\nvolunteer program that combines teaching both marksmanship and history. \n \nWe will also have a legislative update & drawing for a door prize. \n \nWe have the large meeting room reserved from 5:30 PM onward. The actual\nmeeting is from 7:00-8:00PM. There is no \ncharge to attend, unless you choose to eat. Tell the cashier you are there for\nthe TFA meeting & receive a discount. Come early \nto eat, greet, and meet! \n \nTFA events are always family-friendly, and you do not have to be a member to\nattend. \n \nHope to see you there! \n \nDavid\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Nashville Chapter meeting, September 16","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/4809D1E01B7A61A73D19487EE6ECF7251C902CF1"},"hasTitlePart":{"text":"Nashville Chapter meeting, September 16","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/thread/7B4B3226FEAA57C2B451D4C04DA353814E094F4E"}
