{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"20002"},"a":"Thread","hasPost":{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"35618"},"a":"Post","dateCreated":"2012-09-07T07:10:00","hasFeatureCollection":{"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"bandit2012","featureValue":"bandit2012"},"uri":"http://dig.isi.edu/atf/data/post/B3B94D4E6CE23CF796DE588541EED4DE0F26AAF2/featurecollection"},"hasBodyPart":{"text":"\n\nI'm looking for a parts gun for a Rem 11-87 premier 12ga. Do not really need\nthe barrel or stock or forearm. Just really need the receiver and tube\nsection(But I would take the whole gun). If you have one and would like to get\nrid of it at a reasonable price let me know. I am wanting to build this for my\ndaughter who has struck interest in guns. Thanks for your help.\n![:D](./images/smilies/icon_biggrin.gif)\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"11-87 Premier 12ga","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/B3B94D4E6CE23CF796DE588541EED4DE0F26AAF2"},"hasTitlePart":{"text":"11-87 Premier 12ga","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/thread/7DB41C0C09BBE83890450DC2A87EE23EAB547EBD"}
