{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"22326"},"a":"Thread","hasPost":[{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"40273"},"a":"Post","dateCreated":"2014-06-05T08:36:00","hasFeatureCollection":{"memex:pricesMentioned_feature":{"featureName":"prices_mentioned","memex:pricesMentioned":"600","a":"Feature","featureValue":"600"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"admin","featureValue":"admin"},"uri":"http://dig.isi.edu/atf/data/post/64B8F0BFF72066B274E61FA8B5DEFDB0790C3CC9/featurecollection"},"hasBodyPart":{"text":"\n\n![](images/spacer.gif)| ![](images/spacer.gif)| ![](images/spacer.gif) \n---|---|--- \n![](images/spacer.gif)|\n\nrosyshooter wrote:\n\nHi from Utah. Early Elliot 32. Long time shooter and collector. Newly acquired\nbatch of guns I'm trying to figure out. I'm looking at this little 4 barrel\npistol. It looks to be in about 80-90% condition. Sir#28x in 3 places and\nseems to all work fine. Wood grips and all nickel plated. All look to be\noriginal condition. There is a few scratches around the screw the barrel\npivots on. Cabelas offered $600 for it. Is that reasonable? Thanks.\n\n| ![](images/spacer.gif) \n![](images/spacer.gif)| ![](images/spacer.gif)| ![](images/spacer.gif) \n \n \n \nWe tend not to do appraisals, but in that condition you can certainly do\nbetter. \n \nIf your happy with $600, put it up with some photo's on gunbroker.com with\nthat starting price and see where it goes, you only pay them (it's a small\npercent) if it sells so you have nothing to loose. \n \nLets just say if your selling it for $600, where do I send the check\n![;\\)](./images/smilies/icon_wink.gif)\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Re: Elliot 32 plated.","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/64B8F0BFF72066B274E61FA8B5DEFDB0790C3CC9"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"40269"},"a":"Post","dateCreated":"2014-06-04T20:41:00","hasFeatureCollection":{"memex:pricesMentioned_feature":{"featureName":"prices_mentioned","memex:pricesMentioned":"600","a":"Feature","featureValue":"600"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"rosyshooter","featureValue":"rosyshooter"},"uri":"http://dig.isi.edu/atf/data/post/926818EBCB5EF283F3EA08E0127207C8E6E4CE64/featurecollection"},"hasBodyPart":{"text":"\n\nHi from Utah. Early Elliot 32. Long time shooter and collector. Newly acquired\nbatch of guns I'm trying to figure out. I'm looking at this little 4 barrel\npistol. It looks to be in about 80-90% condition. Sir#28x in 3 places and\nseems to all work fine. Wood grips and all nickel plated. All look to be\noriginal condition. There is a few scratches around the screw the barrel\npivots on. Cabelas offered $600 for it. Is that reasonable? Thanks.\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Elliot 32 plated.","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/926818EBCB5EF283F3EA08E0127207C8E6E4CE64"}],"hasTitlePart":{"text":"Elliot 32 plated.","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/thread/8B071F66FD580F7714BF674495D3C9B201ABC6CF"}
