{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"42998"},"a":"Thread","hasPost":{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"380461"},"a":"Post","dateCreated":"2013-10-02T16:31:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Berks county PA","featureValue":"Berks county PA"},"memex:pricesMentioned_feature":[{"featureName":"prices_mentioned","memex:pricesMentioned":"15","a":"Feature","featureValue":"15"},{"featureName":"prices_mentioned","memex:pricesMentioned":"10","a":"Feature","featureValue":"10"}],"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"treefarmer","featureValue":"treefarmer"},"uri":"http://dig.isi.edu/atf/data/post/828F3887629A17E8035A0DB157AB45DADB46A8C2/featurecollection"},"hasBodyPart":{"text":"\n\nHello, \nI'm looking to learn how to graft trees first hand this Winter. I have\nrootstocks but I'm looking for scion wood from mature good producing trees. \nI need Apple, Pear, Pecan, English Walnut and Chinese Chestnut for starters. I\nwould like to offer trades for your scion wood. I have Oak seedlings, Pariffin\nwax candles and poured lead 1 lb. bars. If your looking for something\nparticular let me know. The only expense will be shipping fee of $10-$15 for\npriority shipping. If interested please drop me a message and we'll go from\nthere. \nScion wood is this years new growth of straight branches that average 1/4-3/4\ninch in diameter. \nThank you \nTreefarmer\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Scion wood needed will trade.","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/828F3887629A17E8035A0DB157AB45DADB46A8C2"},"hasTitlePart":{"text":"Scion wood needed will trade.","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/thread/93771546BB6C8BA6F8DA3FB50CF320C4D2D44984"}
