{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"42652"},"a":"Thread","hasPost":[{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"377206"},"a":"Post","dateCreated":"2013-09-17T21:44:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Redmond, Oregon","featureValue":"Redmond, Oregon"},"memex:pricesMentioned_feature":{"featureName":"prices_mentioned","memex:pricesMentioned":"21.95","a":"Feature","featureValue":"21.95"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"surfjam","featureValue":"surfjam"},"uri":"http://dig.isi.edu/atf/data/post/C83C8E19D62592B6D4F3487F837109DF86340699/featurecollection"},"hasBodyPart":{"text":"\n\nIs that a Navy work related network? Maybe they don't consider work related?\nNot sure why it would be blocked otherwise. \n \nEdit: Upon further research, perhaps they view us with the same regard as Fox\nNews: [http://blogs.militarytimes.com/scoopdec ... news-\nsite/](http://blogs.militarytimes.com/scoopdeck/2010/04/16/whew-sailors-\nregain-access-to-fox-news-site/) \n![:help:](./images/smilies/help.gif)\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Re: Deal of the Day: Save $21.95 on 72 Hours Food Kit","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/C83C8E19D62592B6D4F3487F837109DF86340699"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"377201"},"a":"Post","dateCreated":"2013-09-17T21:27:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"North East Florida","featureValue":"North East Florida"},"memex:pricesMentioned_feature":{"featureName":"prices_mentioned","memex:pricesMentioned":"21.95","a":"Feature","featureValue":"21.95"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"Das Sheep","featureValue":"Das Sheep"},"uri":"http://dig.isi.edu/atf/data/post/20704EC8499BBF03DA62173AD34534D4CC7F07C6/featurecollection"},"hasBodyPart":{"text":"\n\nFor what ever reason your website is blocked by NMCI (navy internet). \n \nDoes sound like a neat deal. \n \nAccess to this site has been denied in accordance with Navy Policy to\nsafeguard the security posture and/or maintain the operational integrity of\nthe Navy-Marine Corps Intranet (NMCI) network. \n \n\\-----------------------------------------------------------------------------\n--- \n \nReason: Category[\"Placeholders\"] is filtered. \nURL: [http://shop.survivalfoodprep.com/Storab ...\nldren.html](http://shop.survivalfoodprep.com/Storable-Food/Variety-Kits/72\n-Hour-Supply-Kit-2-Adult-2-Children.html) \nLogin ID: NADSUSEA\\ \nTime: [17/Sep/2013:21:23:52 -0400] \n \n \n\\-----------------------------------------------------------------------------\n--- \n \n \nIf there is an operational requirement to access this website or link, please\ncomplete and submit the URL Unblock Request Form located on Homeport. \n \nClick here for URL Unblock Request Form. \n \nNOTE: For non urgent requests, users should submit via their Ech II CIOs per\nthe routing on the Unblock Request Form. If an unblock request is of an urgent\nnature, requiring review and action within two hours, unblock request with\noperational impact should be provided directly to the Naval Network Warfare\nCommand Battle Watch Captain (contact info below).\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Re: Deal of the Day: Save $21.95 on 72 Hours Food Kit","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/20704EC8499BBF03DA62173AD34534D4CC7F07C6"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"377150"},"a":"Post","dateCreated":"2013-09-17T17:42:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Redmond, Oregon","featureValue":"Redmond, Oregon"},"memex:pricesMentioned_feature":{"featureName":"prices_mentioned","memex:pricesMentioned":"21.95","a":"Feature","featureValue":"21.95"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"surfjam","featureValue":"surfjam"},"uri":"http://dig.isi.edu/atf/data/post/2D2588124B53C7CA8890CF9C733A5C1A7E11A0CC/featurecollection"},"hasBodyPart":{"text":"\n\nToday's Deal of the Day: Save $21.95 on our 72 Hour Supply Kit (2 Adult + 2\nChildren) from Food Supply Depot \n \n[http://shop.survivalfoodprep.com/Storab ...\nldren.html](http://shop.survivalfoodprep.com/Storable-Food/Variety-Kits/72\n-Hour-Supply-Kit-2-Adult-2-Children.html) \n \nWe feature Food Supply Depot products because there is simply no better\ntasting long-term storage food available. This bucket is an ideal variety of\ntheir most delicious reasons why that's so true. \n \nWith a total of 17,750 calories, this 72-hour kit provides nine balanced\nmeals, beverages and staples.You have almost 18,000 calories to divide between\nthe members of your family.\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Deal of the Day: Save $21.95 on 72 Hours Food Kit","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/2D2588124B53C7CA8890CF9C733A5C1A7E11A0CC"}],"hasTitlePart":{"text":"Deal of the Day: Save $21.95 on 72 Hours Food Kit","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/thread/96AD0F966589223030B4FF18CA126F6318AD74E8"}
