{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"18695"},"a":"Thread","hasPost":[{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"214801"},"a":"Post","dateCreated":"2013-12-27T17:01:00","hasFeatureCollection":{"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"ObiRich","featureValue":"ObiRich"},"uri":"http://dig.isi.edu/atf/data/post/86908DB24731BC6004CB8C700D0ACDA484A70F75/featurecollection"},"hasBodyPart":{"text":"Ok guys, I'm going to expose my ignorance, but I've noticed that there is a\nplethora of different bullet types for ARs. So...if I was to want some for\nbasic defense, what types are there and what are their advantages?\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"AR-15 Ammo","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/86908DB24731BC6004CB8C700D0ACDA484A70F75"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"214806"},"a":"Post","dateCreated":"2013-12-27T18:52:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Provo","featureValue":"Provo"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"gskip33","featureValue":"gskip33"},"uri":"http://dig.isi.edu/atf/data/post/A894E03A60DE37703E2449DF112C652A5E5F2640/featurecollection"},"hasBodyPart":{"text":"\n\nI'd go with the standard 55 grain 5.56 rounds (like federal brown box xm193 or\nsomething similar). \nSome people also like the 77 grain Sierra Match King (some ARs like 69 grain,\nothers like 77). \n \nBoth are good, I like the federal brown box. I would NOT use the XM855 (62\ngrain penetrator rounds). Everything I read says they do not reliably\nfragment.\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Re: AR-15 Ammo","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/A894E03A60DE37703E2449DF112C652A5E5F2640"}],"hasTitlePart":{"text":"AR-15 Ammo","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/thread/97F6F5FCEF5301C62E7ED89E6C794E38218C4B1E"}
{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"1928"},"a":"Thread","hasPost":{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"11182"},"a":"Post","dateCreated":"2006-12-13T06:48:00","hasFeatureCollection":{"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"Killer-B","featureValue":"Killer-B"},"uri":"http://dig.isi.edu/atf/data/post/F0228B7BEEA4B5F0D7392873936E73C2D838FEA8/featurecollection"},"hasBodyPart":{"text":"AirgunAdvice has recently gone through some technical and operational changes\nand is now ready for posting. We ask you to enjoy yourselves while using the\nforum. \n \nThe forum is moderated, as we feel that AirgunAdvice should be a forum where\neveryone can learn and share airgunning experiences without fear of reprisal.\nIt is the exchange of experience and information that makes forums successful.\nTo this end, we reserve the right to delete any and all posts that are deemed\ninappropriate to the good of the whole group. Be aware that airgunning is a\nsmall world. \n \nThe heart of the forum is the depth and breadth of knowledge the users posses\nand their willingness to share that knowledge. Although disagreements and\ndifferences of opinion are always welcome as part of the forum's discussions -\nplease remember we are here for fun not blood. Please be respectful of others. \n \nThe following standards of moderation will be applied to AirgunAdvice: \n \n1. The following will not tolerated AT ALL, an immediate action will be taken: \nObscenity \nPornography \nNudity of any type \nRacial Slurs \nThreats \nBashing \nPersonal Attacks/Insults, name calling directed at a Member(s) \nAny forms of hijacking of a thread \n \n2. Posts that are obvious baiting and/or looking for trouble will be deleted, repeat offenders will be BANNED!!!. \n \n3. Posts that may bring unwanted attention or discredit to airgunning will be deleted. \n \n4. All I.P. addresses are logged for the protection of this forum and it's members. \n \n5. At anytime we feel that the integrity of this forum is threatened by any message posted on this forum. The offending message and IP logs of anyone involved will be handed over to the proper authorities! \n \n6. No talk or pictures of the ILLEGAL killing of animals, or miss use of Airguns that would put our sport in a bad light will not be tolerated. Repeat offenders will be banned from this site. \n \n7. No links in signature lines to other Airgun Forums without the consent of ADMIN. \n \n8. Please do not take PMs that you received from other members and re-post them either in whole or in part on the general forum for all to see. PMs are called Private Messages for a reason, so please keep them PRIVATE. If you have a problem with a member contact me, and I will deal with it. \n \n9. Don't complain on the general forum about the way this website is run, or why posts got deleted. Email or PM me (Killer-B) a explanation or read these rules. \n \n10. You may have 1 picture in your Avatar, and if you choose to but a picture in your signature line you may have just one, but it must be on the small side so as not to be confused with a actual post with a picture in it. I will contact you by PM if I feel the size is to big. \n \n11. Users that are exposed for having Multiple different identities on this board will be banned. \n \n12\\. If we the Moderators or Admin feel that a Thread is becoming repetative,\nand nothing new being added to the topic we will Lock the Thread. \n \n \nThere have been members in the past that have complained when their post has\nbeen deleted on this forum, that their \"FREE SPEECH\" rights have been\nviolated. Since this is a private forum \"FREE SPEECH\" does not apply...... our\nsite has Rules, some less restrictive then other forums, and some more\nrestrictive. See rule #9. \n \nPosts that will not be deleted include good arguments among members involving\nspecs, performance, etc. of airguns or associated equipment/supplies. It is\ngood to hear both sides and the input from many, but again no personal\nattacks, name calling and the like. \n \nAlso if a member has NEVER posted a single post on this forum, after a period\nof 6 months to a year their membership will be deleted from the database, this\nis in an effort to keep the board alive with active members. \n \nYour cooperation will be most appreciated. \n \nKILLER-B \n \n(Site Admin) \n_________________ \n\"We live for another day of Airgunning\"\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Rules of The Forum","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/F0228B7BEEA4B5F0D7392873936E73C2D838FEA8"},"hasTitlePart":{"text":"Rules of The Forum","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/thread/9A786B3215C030AEE96A5C9284A52160CDF1964C"}
