{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"77129"},"a":"Thread","hasPost":[{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"974372"},"a":"Post","dateCreated":"2015-04-12T11:14:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Arlington","featureValue":"Arlington"},"memex:pricesMentioned_feature":{"featureName":"prices_mentioned","memex:pricesMentioned":"1000000","a":"Feature","featureValue":"1000000"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"joe817","featureValue":"joe817"},"uri":"http://dig.isi.edu/atf/data/post/7460DF1DD352CF61F76E2FC9E509659A18F95022/featurecollection"},"hasBodyPart":{"text":"\n\n1758 - Lus Antonio Menchaca and Andrs Hernndez resolved a title dispute\ninvolving Menchaca's San Francisco ranch. Their compromise resulted in the\noldest recorded private land grant in Texas. The grant, recorded in the\nGeneral Land Office, consisted of a total of fifteen leagues and seven labores\nin present-day Karnes and Wilson counties, of which eleven leagues and two\nlabores went to Menchaca and four leagues and five labores to Hernndez. It is\npossible that this was the site of the first ranch in Texas. Hernndez's ranch\nheadquarters was in the same locale as Fuerte de Santa Cruz del Cbolo. \n \n1836 - Mexican forces under General Santa Anna captured Thompson's Ferry, on\nthe Brazos River between San Felipe and Fort Bend. As Sam Houston's army\nretreated eastward, a rear-guard under Moseley Baker at San Felipe and Wyly\nMartin at Fort Bend sought to prevent the Mexicans from crossing the Brazos.\nAt Thompson's Ferry on April 12, Mexican colonel Juan N. Almonte hailed the\nferryman, who was on the east bank. Probably thinking that Almonte was a\ncountryman who had been left behind during the retreat, the ferryman poled the\nferry across to the west bank. Santa Anna and his staff, who had been hiding\nin nearby bushes, sprang out and captured the ferry. By this means the Mexican\nCentralists accomplished a bloodless crossing of the Brazos. The Texan forces\nat Fort Bend and San Felipe were forced to abandon their defenses and join the\nrest of Houston's army in retreat. But the Mexicans make a huge tactical\nerror. 1,500 troops and four cannons are will remain to guard the ferry. Had\nthey received word of Santa Anna's defeat just two days march ahead of them,\nthey could easily have stolen victory from the Texans. \n \n1844 - An annexation treaty was completed on April 12, 1844, and signed by\nSecretary of State John C. Calhoun, Isaac Van Zandt, and Van Zandt's\nassistant, J. Pinckney Henderson. President Sam Houston favored a \"diplomatic\nact,\" but Anson Jones, the president elect, balked. Jones wanted annexation\nand thought that the threat of an alignment with England, connected with the\ncotton trade, was the key to achieving it. In June 1844 the United States\nSenate voted thirty-five to sixteen to reject the treaty. \n \n1879 - Wheeler County became the first organized county in the Texas\nPanhandle. The Kiowas and Comanches, who displaced the earlier Apache peoples\naround 1700, dominated the area until the mid-1870s. By that time buffalo\nhunters had already established a settlement, called Hidetown or Sweetwater,\nin the area. The U.S. Army established Fort Elliott near Hidetown in 1875, and\nthe first post office in the Panhandle opened there in 1878. The legislature\nestablished Wheeler County, named for Royal T. Wheeler, in 1876. Three years\nlater, the residents of the area petitioned for county organization, which\nbecame official on April 12. The small camp of Sweetwater became the first\ncounty seat; it was renamed Mobeetie in 1880. \n \n1919 - Broadway actress Ann Miller was born in Chireno (Nacogdoches Co).\nMiller stared in 40 movies and made numerous television shows. She had been a\ntap dancer since she was a young child. It was Ann who discovered Lucille Ball\nwhile visiting a San Francisco nightclub. Known as the \"Queen of Tap\", Ann\nMiller had her legs insured by RKO pictures for $1,000,000. She died in 2004\nat the age of 80. \n \n1927 - An F5 tornado touched down just northwest of Rocksprings, and began the\nviolent march into the small town in the Western Hill Country. The tornado\ndestroyed 235 of Rockspring's 247 buildings and killed 74 people, almost 1/3\nof the population. Clearing Rocksprings, it continued southeastward for\nanother estimated 50 miles. With the death toll at 74 dead and 205 injured,\nthe Rocksprings tornado is to date, the third deadliest tornado in Texas\nhistory, behind the Waco tornado of 1953, and Goliad of 1902. \n \n1987 - The Daughters of the Republic of Texas dedicated a bronze and marble\nplaque at the site where the original international boundary marker between\nthe United States and the Republic of Texas still stands. \n \n1991 - Following the Gulf War, the Department of Defense labeled Fort Hood a\ntop fighting installation and stationed 12,000 additional troops there. In\nDecember 1992 the Fifth Infantry Division was inactivated and redesignated the\nSecond Armored Division.\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"This Day In Texas History - April 12","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/7460DF1DD352CF61F76E2FC9E509659A18F95022"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"974375"},"a":"Post","dateCreated":"2015-04-12T11:30:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Seguin","featureValue":"Seguin"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"ELB","featureValue":"ELB"},"uri":"http://dig.isi.edu/atf/data/post/CC12AF573E91D8BD7FD52AC1288D4BA7913E3692/featurecollection"},"hasBodyPart":{"text":"\n\n1987 - The Daughters of the Republic of Texas dedicated a bronze and marble\nplaque at the site where the original international boundary marker between\nthe United States and the Republic of Texas still stands. \n \n[http://www.texasescapes.com/GeraldMasse ...\n-Texas.htm](http://www.texasescapes.com/GeraldMassey/Last-Remaining-\nInternational-Boundary-for-Republic-of-Texas.htm)\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Re: This Day In Texas History - April 12","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/CC12AF573E91D8BD7FD52AC1288D4BA7913E3692"}],"hasTitlePart":{"text":"This Day In Texas History - April 12","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/thread/A5D42F8692D6D2EF7D9532CCF355AE17D644AB86"}
