{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"21041"},"a":"Thread","hasPost":[{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"201847"},"a":"Post","dateCreated":"2012-10-24T21:20:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Rockford, MI","featureValue":"Rockford, MI"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"JD338","featureValue":"JD338"},"uri":"http://dig.isi.edu/atf/data/post/37CADBA38E5E66C84E4BE3C92D91F3562E2127D3/featurecollection"},"hasBodyPart":{"text":"\n\nHere is his personal info... \n \nralph ditore \n[milboltnut@gmail.com](mailto:milboltnut@gmail.com) \n \n \n \nJD338\n\n \n_________________ \nSpeed sells but Accuracy kills. \n \nNoslers Rock\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Unsolicited PM's?????","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/37CADBA38E5E66C84E4BE3C92D91F3562E2127D3"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"201803"},"a":"Post","dateCreated":"2012-10-24T16:52:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Cheyenne, WY","featureValue":"Cheyenne, WY"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"FOTIS","featureValue":"FOTIS"},"uri":"http://dig.isi.edu/atf/data/post/D809E04FA9ECE32B5B8D85F123988A3919762013/featurecollection"},"hasBodyPart":{"text":"\n\nIt has come to my attention that some of our \"star\" banned trolls still have\nPM capability. \nIf some of you have been harassed and want it stopped, please follow these\ninstructions: \n \n \n1) Make person a foe under friends & foes \n2) Go to rules, folder, & settings \n3)Under add new rule select \"sender\" from drop down menu and hit \"next\" button\non far right. \n4) Select \"is foe\" from drop down menu and hit next on far right. \n5) Select \"delete message\" from drop down menu and hit add rule on far right.\n\n \n_________________ \n![Image](http://img.photobucket.com/albums/v514/378fan/usaf-1.png) \n \n**Weatherby was too long so I nicknamed it \"Bee\"**\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Unsolicited PM's?????","a":"WebPageElement"},"hasImagePart":{"a":"ImageObject","uri":"http://dig.isi.edu/atf/data/image/E47B25444057F96C0BE88AA3C5F23BD1B3E101EB"},"uri":"http://dig.isi.edu/atf/data/post/D809E04FA9ECE32B5B8D85F123988A3919762013"}],"hasTitlePart":{"text":"Unsolicited PM's?????","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/thread/AEC73F3331DD524EC4A176A8179B4AD9261E8767"}
{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"7395"},"a":"Thread","hasPost":{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"75254"},"a":"Post","dateCreated":"2014-02-26T09:37:00","hasFeatureCollection":{"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"ICDEDTURKES","featureValue":"ICDEDTURKES"},"uri":"http://dig.isi.edu/atf/data/post/BCC2C6C85B6F7C17FA455C40A5F879EF122A1B70/featurecollection"},"hasBodyPart":{"text":"\n\nI think it should be required to measure all birds with this \n \n<http://www.gobblergauge.com/>\n\n \n_________________ \nHooks Custom Calls Pro-Staff\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Measuring","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/BCC2C6C85B6F7C17FA455C40A5F879EF122A1B70"},"hasTitlePart":{"text":"Measuring","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/thread/AEF006503194116A4303DA34D8C3808F0EEF5FDE"}
{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"19784"},"a":"Thread","hasPost":[{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"226285"},"a":"Post","dateCreated":"2014-10-10T21:42:00","hasFeatureCollection":{"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"Cinhil","featureValue":"Cinhil"},"uri":"http://dig.isi.edu/atf/data/post/43BC34BCA4D68F57CFD20E3BCF94CBC3DE43BB04/featurecollection"},"hasBodyPart":{"text":"\n\nI posted replies to a thread concerning this issue a couple years ago, try a\nsearch for gunsmiths and you should be directed to the thread. \n \n \nUpdate; \nThere are a dozen or so pages on concerning this, the following may be more\nhelpful; \n[http://ogdenut.localguides.com/ypcyello ... MgodcXcAeg](http://ogdenut.localg\nuides.com/ypcyellow/guns_gunsmiths.html?a1=1&a2=6237593632&a3=20562677166&a4=b\n&gclid=CNHe9rLYo8ECFUMLMgodcXcAeg)\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Re: need gunsmith for quick sight change - Ogden","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/43BC34BCA4D68F57CFD20E3BCF94CBC3DE43BB04"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"226267"},"a":"Post","dateCreated":"2014-10-10T16:40:00","hasFeatureCollection":{"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"fx17","featureValue":"fx17"},"uri":"http://dig.isi.edu/atf/data/post/D05850C2AF16F5AFB1377C8136BA00E3E60F75FA/featurecollection"},"hasBodyPart":{"text":"\n\nI have a Ruger 10/22 takdown, that I bought a set of Williams peep sights for.\nI need someone who can do a quick front sight change for me. It is dovetailed,\nbut I can't budge it with my punch set. I'm afraid I'll break, or ruin\nsomething If I pound harder. \n \nNeed someone in the Brigham City to Ogden area. \n \nthanks\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"need gunsmith for quick sight change - Ogden","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/D05850C2AF16F5AFB1377C8136BA00E3E60F75FA"}],"hasTitlePart":{"text":"need gunsmith for quick sight change - Ogden","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/thread/B47CF32120A1C6AABA10F0D3FBADB93AE00B09F3"}
