{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"3161"},"a":"Thread","hasPost":{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"28798"},"a":"Post","dateCreated":"2014-11-17T23:00:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"PNW","featureValue":"PNW"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"Taprack","featureValue":"Taprack"},"uri":"http://dig.isi.edu/atf/data/post/2C8F29853F8E295DC84D51F457648539B529B97C/featurecollection"},"hasBodyPart":{"text":"\n\nNew to the forum but I've already learned a ton. I put a laser on my gun\ntoday, my eyes don't like the brass bead and I had a cheap laser with pressure\npad laying around. My gun is a .357, with pistols I zero lasers at 25 yards,\nthink I should go a little further out with this gun or stick to 25? \n \nI'm gonna shoot it some more tomorrow. I read a lot of bad words about these\nlittle guns prior to getting one, but so far mine has been perfect. (It does\nshoot high)\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Lasers","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/2C8F29853F8E295DC84D51F457648539B529B97C"},"hasTitlePart":{"text":"Lasers","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/thread/B9011257A02FCF56DAC010F090F9C94D868CBED5"}
{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"119062"},"a":"Thread","hasPost":[{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"1051086"},"a":"Post","dateCreated":"2015-04-14T17:42:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"south ms","featureValue":"south ms"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"3seasons","featureValue":"3seasons"},"uri":"http://dig.isi.edu/atf/data/post/892736346059CD6309B45A77027E8F9F872B0CB6/featurecollection"},"hasBodyPart":{"text":"\n\nCongrats!!!\n\n \n_________________ \nHRCH Roux's Black River Wild Child MH (Coal) \nHigh Cotton's Tootsie Roll\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Persistence Cont.","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/892736346059CD6309B45A77027E8F9F872B0CB6"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"1051081"},"a":"Post","dateCreated":"2015-04-14T16:25:00","hasFeatureCollection":{"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"teul2","featureValue":"teul2"},"uri":"http://dig.isi.edu/atf/data/post/375A7A16E003C03B04DD933B660448E7B85EAA2B/featurecollection"},"hasBodyPart":{"text":"\n\nAwesome! \nGood job!\n\n \n_________________ \nLooking for 2 duck calls from Dominic Serio of Greenwood (ones for Novacaine) \nI chose to stand my ground, not out of pure guts and bravery, but more out of\nmassive quantities of liquid courage combined with a complete lack of physical\nconditioning\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Persistence Cont.","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/375A7A16E003C03B04DD933B660448E7B85EAA2B"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"1051071"},"a":"Post","dateCreated":"2015-04-14T14:19:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"NE MS","featureValue":"NE MS"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"Duck Chaser","featureValue":"Duck Chaser"},"uri":"http://dig.isi.edu/atf/data/post/13BB253D158C155808E533621A131CA9F1D78210/featurecollection"},"hasBodyPart":{"text":"\n\nI've had a good season, but this one takes the cake. Talk about a load off...\nMy boy missed one opening week. Wasn't an easy shot, but stung anyway. He\nkilled this one Saturday at 1-something. Told him when we walked out of the\nbottom, it had been 8 hours since we were standing there waiting on daylight.\nHe's been on 3 hunts like that since the miss, so he earned this one. I've\nnever seen him so determined to do anything. He pushed me to keep going a\ncouple times this year and the persistence paid off. If you're looking for a\nchallenge, try getting a kid a couple shots having basically 1 day a week to\nwork with. Hasn't been easy for me, but worth it all for this. \n \n[![Image](http://i28.photobucket.com/albums/c225/duckch/15/bl-\nturkey15.jpg)](http://s28.photobucket.com/user/duckch/media/15/bl-\nturkey15.jpg.html)\n\n \n_________________ \nHRCH Rusty MH\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Persistence Cont.","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/13BB253D158C155808E533621A131CA9F1D78210"}],"hasTitlePart":{"text":"Persistence Cont.","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/thread/BAC6B9AE058A344DEFA29B765C262D781B8F7E58"}
{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"46964"},"a":"Thread","hasPost":[{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"586992"},"a":"Post","dateCreated":"2013-02-23T21:02:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"East Linda Caif.","featureValue":"East Linda Caif."},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"pwl44m","featureValue":"pwl44m"},"uri":"http://dig.isi.edu/atf/data/post/7532773810B1FB93472BA41DD7D6D4AE0D4E25DF/featurecollection"},"hasBodyPart":{"text":"\n\nWhat have I done now ? Blaines the one that said it. Said what ? \nThank You Hobie, I know not of what You speak but thank You. \nJust a week ago My Wife and I were at Our property in the Hills showing it to\npotential Renters. One of the other family was using some colorful language. I\ninterrupted and said \"see that Woman over there,thats My Wife\". He quickly\nrecanted and apoligized. \nSeems like I remember something recently and thinking \"Wow , a newby no less\".\nSure comes in handy being old sometimes (forgetful)\n![:lol:](./images/smilies/icon_lol.gif) \nPerry\n\n \n_________________ \nPerry in Bangor----++++===Calif\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Recently deleted topic... (Forum behavior)","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/7532773810B1FB93472BA41DD7D6D4AE0D4E25DF"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"586924"},"a":"Post","dateCreated":"2013-02-23T16:42:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Staunton, VA, USA","featureValue":"Staunton, VA, USA"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"Hobie","featureValue":"Hobie"},"uri":"http://dig.isi.edu/atf/data/post/566B9CD0F53A12A3789CB7890C65741DBA3CFC47/featurecollection"},"hasBodyPart":{"text":"I recently deleted an entire topic because the tone and language used had long\nlost its acceptability for this forum. I should point out that if a person\nviolates the rules of discourse here (well understood by our many long time\nmembers) then I should be told so that I can take care of it BEFORE we have to\nlose a whole discussion to cleanse the forum. I should also point out that\nwhile I don't \"ban\" people for disagreeing with me, I have banned them for\nthreats of physical violence, trolling, and spamming. If you want to disagree\nhere you have to present reason, not resort to name calling. Ad hominem\nattacks will simply be deleted, no explanation from me is necessary as the\nposter knows what they posted/typed.\n\n \n_________________ \nSincerely, \n \nHobie \n \n\"We are all travelers in the wilderness of this world, and the best that we\nfind in our travels is an honest friend.\" Robert Louis Stevenson \n[![Image](http://i29.photobucket.com/albums/c288/TheRealHobie/Web%20Page%20Des\nign/HobieLogo1-1.jpg)](http://shootingwithhobie.blogspot.com/)\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Recently deleted topic... (Forum behavior)","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/566B9CD0F53A12A3789CB7890C65741DBA3CFC47"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"586989"},"a":"Post","dateCreated":"2013-02-23T20:58:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Staunton, VA, USA","featureValue":"Staunton, VA, USA"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"Hobie","featureValue":"Hobie"},"uri":"http://dig.isi.edu/atf/data/post/2F703D1B1FAB429F227ADED2321640A36F038CD0/featurecollection"},"hasBodyPart":{"text":"\n\nBTT\n\n \n_________________ \nSincerely, \n \nHobie \n \n\"We are all travelers in the wilderness of this world, and the best that we\nfind in our travels is an honest friend.\" Robert Louis Stevenson \n[![Image](http://i29.photobucket.com/albums/c288/TheRealHobie/Web%20Page%20Des\nign/HobieLogo1-1.jpg)](http://shootingwithhobie.blogspot.com/)\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Recently deleted topic... (Forum behavior)","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/2F703D1B1FAB429F227ADED2321640A36F038CD0"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"586986"},"a":"Post","dateCreated":"2013-02-23T20:45:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Staunton, VA, USA","featureValue":"Staunton, VA, USA"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"Hobie","featureValue":"Hobie"},"uri":"http://dig.isi.edu/atf/data/post/6234D69CFA431AF0333A3019CB3187E4ED01C097/featurecollection"},"hasBodyPart":{"text":"\n\nI'm surprised this post hasn't elicited a response from anyone. I'm going to\nrepeat something that our old friends know all too well but new members\napparently need to learn. You're visiting somebody's/everybody's living room\nand we expect at least a modest bit of decorum. Further, you've just been\nintroduced. We expect you to behave just as you would when you've just been\nintroduced to a new neighbor. If you insist on kicking the cat, spilling\ncoffee on the wife's new carpet or cussin' in front of my grandbabies I'll do\njust what I'd do if you were actually in my house. \n \nOld friends here who know each other after YEARS of contact might be a little\nrougher with one another, that doesn't give you leave to do the same. Age 13\nor 99 new forum members are the young kids here. If you want respect, you have\nto earn it. If you want to discuss a subject you'd better bring your thinking\ncap. \n \nI suppose that it is necessary to add (again) that I don't live my life\nreading all the posts in real time. A reported post in a topic is the first to\ndraw my attention but I will read the rest of the posts and have and will\ndelete a whole topic when the members cross the line. If you don't think\nthat's fair, well, I'm not the omniscient, omnipresent one so that's pretty\nmuch what you're stuck with. Although I've tried to rephrase, again and again,\nthe standards for the forum, those standards haven't changed in 10 years. As\nlong as I'm the moderator I'm going to do what I was asked to do.\n\n \n_________________ \nSincerely, \n \nHobie \n \n\"We are all travelers in the wilderness of this world, and the best that we\nfind in our travels is an honest friend.\" Robert Louis Stevenson \n[![Image](http://i29.photobucket.com/albums/c288/TheRealHobie/Web%20Page%20Des\nign/HobieLogo1-1.jpg)](http://shootingwithhobie.blogspot.com/)\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Recently deleted topic... (Forum behavior)","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/6234D69CFA431AF0333A3019CB3187E4ED01C097"}],"hasTitlePart":{"text":"Recently deleted topic... (Forum behavior)","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/thread/BB31CB518F4A0D7A5E7A914F964667D9ADF27245"}
{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"2292"},"a":"Thread","hasPost":{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"19926"},"a":"Post","dateCreated":"2014-03-09T09:00:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"central Ohio","featureValue":"central Ohio"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"bonefamily","featureValue":"bonefamily"},"uri":"http://dig.isi.edu/atf/data/post/BCAA1DCC28F562C8C147FDED8D049B3F7E497A65/featurecollection"},"hasBodyPart":{"text":"Ok, I admit I am still learning about higher pressure rated ammunition. I just\npurchased a R351 for carry and would like to know more about +P .38 Special\nammo. I believe I understand that the theory behind +P and hollow points is to\ngive the expanding bullet more velocity for deeper penetration. However, how\ndoes the +P react in terms of felt recoil? I assume it is higher, but I have\nnot fired any to confirm this. Also, how do loads with say 130 grain bullets\nvary to 158 grain bullets in terms of felt recoil? Thanks for the help!\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"+P info needed","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/BCAA1DCC28F562C8C147FDED8D049B3F7E497A65"},"hasTitlePart":{"text":"+P info needed","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/thread/BCEB22C981CBB096599FBA60A463D5D7CC48E0ED"}
{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"31903"},"a":"Thread","hasPost":{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"452624"},"a":"Post","dateCreated":"2015-04-08T10:12:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Member LGC: norCal","featureValue":"Member LGC: norCal"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"CDFingers","featureValue":"CDFingers"},"uri":"http://dig.isi.edu/atf/data/post/C28500360E3AEC8BB0A9C36FADB67A1E5F00E787/featurecollection"},"hasBodyPart":{"text":"\n\nMany correlations are hauled out in this article. Some ring true, but some are\nhauled out from the nether regions. \n \nThe \"Department of Precrime.\" If we postulate that humans do stupid shit, we\ncan posit that those who don't do stupid shit may need guns against those who\ndo do stupid shit. \n \nAs senorgrand noted last year, if the .gov puts a stigma on things like\nviolent tendencies, then people will not seek help for fear of some kind of\nrestriction or confiscation. This is bad. Here is that thread: \n \n[viewtopic.php?f=52&t=29425&p=409163&hilit=mental+health#p409163](http://www.t\nheliberalgunclub.com/phpBB3/viewtopic.php?f=52&t=29425&p=409163&hilit=mental+h\nealth#p409163) \n \nIt is better to accept that humans may do stupid shit. \n \n\n**Quote:**\n\n\u201cWith gun violence, you need two things: dangerous people and guns,\u201d he said.\n\u201cIn this country, we can\u2019t limit gun ownership, so we have to focus more on\ndangerous people, and that\u2019s complicated.\u201d Current criteria for restricting\nspecific individuals\u2019 gun ownership is both too broad and too narrow, he said,\nidentifying too many who aren\u2019t violent and not enough of those who are. But\nthree states have come up with ways to address the issue. Connecticut and\nIndiana have laws allowing preemptive seizure of firearms \u2013 subject to due\nprocess \u2013 from high-risk individuals, and California recently enacted a \u201cgun\nviolence restraining order,\u201d building on the existing system of restraining\norders.\n\n \nlink: \n \n[http://www.forbes.com/sites/tarahaelle/ ...\n-violence/](http://www.forbes.com/sites/tarahaelle/2015/04/08/seize-guns-from-\nangry-people-and-reduce-firearm-violence/) \n \nIf we assume that some people could benefit from seeking treatment without\nfear of gun confiscation, then we should develop a better way of dealing with\nthat person's guns. I suggest that three local gun stores around the person in\nquestion be requested to submit bids to store this person's guns while the\nperson seeks treatment--the patient could select which ever one was\nappropriate. The doctor would sign off when treatment either is complete or\nhas failed, when the person would either get the guns back or have them\nconfiscated or transferred to another owner. \n \nMental health is a real thing. If we don't get out in front of it, more states\nwill pass confiscatory laws; we totally know that \"mental health\" is one of\nthe most controversial and misunderstood categories of well being. Either we\ndefine it or it will be defined for us, and we'll see unnecessary troubles and\nconfiscations. \n \nCDFingers\n\n \n_________________ \nAin't no time to hate; barely time to wait. \nWhat I want to know is, 'where does the time go?'\n\n","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/C28500360E3AEC8BB0A9C36FADB67A1E5F00E787"},"uri":"http://dig.isi.edu/atf/data/thread/BE2279BB6B8467A38E6DFA27B9B94FCE51587728"}
