{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"4341"},"a":"Thread","hasPost":{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"16758"},"a":"Post","dateCreated":"2013-10-04T14:47:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Russellville, TN","featureValue":"Russellville, TN"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"Tim Nunan","featureValue":"Tim Nunan"},"uri":"http://dig.isi.edu/atf/data/post/A49FC971303A655064700AE9A526D93EF1BDB11E/featurecollection"},"hasBodyPart":{"text":"\n\nThe October meeting of the Tennessee Firearms Association Lakeway Chapter will\nbe held on Tuesday evening, the 15th of October, 2013 \n \nDavid & Charby Jones of Brothers Hydrographics and Taxidermy in Rogersville\nwill display and speak on their process of decorating trophy mounts, gun\ncamouflage choices for male/female owners and other items. \n+++++++++++++++++++++++++++++++++++++++++++++++++++++++++++ \nOur meeting place is the Shoney\u2019s Family Restaurant at 1933 West Andrew\nJohnson Highway (Hwy 11E), Morristown TN. This restaurant is located 1/2 block\neast of the West Andrew Johnson highway (Hwy 11E) and Morris Blvd\nintersection, more or less across from the Home Depot. There is a large,\nhighly visible sign in front along with plenty of parking space. A pre-meeting\nsocial hour is from 6 PM to 7 PM during which you may want to eat dinner. The\nmeeting will begin promptly at 7 PM and end at 8 PM. Questions are encouraged. \n \nMembership is not required - gun owners, 2nd Amendment supporters, and\ninterested public are urged to attend. For more information contact Tim Nunan\n423-586-8459/email [bentcreek@lcs.net](mailto:bentcreek@lcs.net)\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"October 2013 meeting","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/A49FC971303A655064700AE9A526D93EF1BDB11E"},"hasTitlePart":{"text":"October 2013 meeting","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/thread/CE05301442A82B120942D4B62E35CA5808F8C89F"}
{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"91001"},"a":"Thread","hasPost":[{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"397745"},"a":"Post","dateCreated":"2015-03-29T10:11:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"The Suburbs of Hillyard","featureValue":"The Suburbs of Hillyard"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"JeremyD","featureValue":"JeremyD"},"uri":"http://dig.isi.edu/atf/data/post/91C79166D3D8DD724C09D5E10282A075470E1CD3/featurecollection"},"hasBodyPart":{"text":"\n\nttt\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Re: 1 box 10mm auto ammo","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/91C79166D3D8DD724C09D5E10282A075470E1CD3"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"398519"},"a":"Post","dateCreated":"2015-04-05T12:09:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"The Suburbs of Hillyard","featureValue":"The Suburbs of Hillyard"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"JeremyD","featureValue":"JeremyD"},"uri":"http://dig.isi.edu/atf/data/post/AAA917521BA8C9F97A3677C56894C8EF8F5C4B73/featurecollection"},"hasBodyPart":{"text":"\n\nStill have it.\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Re: 1 box 10mm auto ammo","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/AAA917521BA8C9F97A3677C56894C8EF8F5C4B73"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"396821"},"a":"Post","dateCreated":"2015-03-22T10:03:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"The Suburbs of Hillyard","featureValue":"The Suburbs of Hillyard"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"JeremyD","featureValue":"JeremyD"},"uri":"http://dig.isi.edu/atf/data/post/69DDB53A9E98FEEDE4AB39AE226E8BA164C0F7BE/featurecollection"},"hasBodyPart":{"text":"\n\nI have a lonely box (50rds) of Armscore 10mm ammo for sale\n![:\\)](./images/smilies/icon_e_smile.gif) \n \n180gr FMJ. \n \nTrade for .223/5.56 or .40 S&W ammo (brass cased only please). \n \nPlease PM all responses. \n \nThanks for looking. \n \n![Image](http://i59.tinypic.com/ei2vb8.jpg)\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"1 box 10mm auto ammo","a":"WebPageElement"},"hasImagePart":{"a":"ImageObject","uri":"http://dig.isi.edu/atf/data/image/E39C4E22C0EFE59117EF5A684C373E5E43F97D7C"},"uri":"http://dig.isi.edu/atf/data/post/69DDB53A9E98FEEDE4AB39AE226E8BA164C0F7BE"}],"hasTitlePart":{"text":"1 box 10mm auto ammo","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/thread/CF6CDE1A2A8E5334B9B240C0E016A5FE47DD5B82"}
{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"284414"},"a":"Thread","hasPost":[{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"3709592"},"a":"Post","dateCreated":"2014-07-14T11:55:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Shelby County","featureValue":"Shelby County"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"DaveB","featureValue":"DaveB"},"uri":"http://dig.isi.edu/atf/data/post/7D3A3B34CB81EA1BDFE277CDAF2E184367184E21/featurecollection"},"hasBodyPart":{"text":"Looking at the pics of all the arrowheads I showed a few to my Wife. Some of\nthe work is very pretty while other is strictly functional. Wife said the\nIndians must have looked a long time for such pretty rocks. That got me\nthinking. I wonder if certain rocks, know from experience to be different or\npretty when worked on, were favored? I mean, was there a guy in the corner hut\nwho traded pretty arrowheads? Kids who searched out certain rock types? I\nalways thought functional was the only criteria but was just wondering.....\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Did Indians favor Pretty?","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/7D3A3B34CB81EA1BDFE277CDAF2E184367184E21"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"3714623"},"a":"Post","dateCreated":"2014-07-20T20:20:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"west tn","featureValue":"west tn"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"in the dog house","featureValue":"in the dog house"},"uri":"http://dig.isi.edu/atf/data/post/D8972266DFE211321E8D582B708A3F3D7AD7A487/featurecollection"},"hasBodyPart":{"text":"\n\nAlso The way a point appears today isn't the same way it looked when it was\nmade. Some materials get a patina on them ( some \"age\" more than others, or\nfaster ) that wasn't present when made. A lot of times when it was made it was\nsolid black. Over time it changes to the colors that we see today. \n \nFt. Payne chert for example is black with white inclusions if you get it out\nof the ground today. Points that are 7000 years old are now brown and bright\nwhite. If you find one that is broken you will see that the inside is still\nblack. \n \nAlso a lot of cherts where heat treated. This makes the material easier to\nwork but also brings out color. All of these change with age. \n \nBut no doubt they favored \"pretty\" rocks. If they found a color in a certain\npart of the rock, it could be worked around the pretty part so that it was\nsaved in the point.\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Re: Did Indians favor Pretty?","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/D8972266DFE211321E8D582B708A3F3D7AD7A487"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"3710272"},"a":"Post","dateCreated":"2014-07-14T21:38:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Lawrence Co. TN","featureValue":"Lawrence Co. TN"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"Rockhound","featureValue":"Rockhound"},"uri":"http://dig.isi.edu/atf/data/post/017A1908A5CD00D91010982E90F4DC125EB5744A/featurecollection"},"hasBodyPart":{"text":"\n\nA lot of it were made out of pretty material because it was just that if it\nwasn't good material it didn't flake well or sharpen well.\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Re: Did Indians favor Pretty?","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/017A1908A5CD00D91010982E90F4DC125EB5744A"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"3710205"},"a":"Post","dateCreated":"2014-07-14T20:39:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Middle Tn","featureValue":"Middle Tn"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"Lost Lake","featureValue":"Lost Lake"},"uri":"http://dig.isi.edu/atf/data/post/78E7DA3A220272C37A133A864F983857F4DB9AC7/featurecollection"},"hasBodyPart":{"text":"\n\nIn some instances, even when local chert and flint was readily available,\ncolorful material was used for Cache or burial goods and was brought in\nthrough trade or a long journey afoot. So yes, in some instances they did\nprefer pretty over the usual. \n \nThat was true of many tools and necessities besides rock too. Certain bow\nwoods were preferred in some areas and it grew well outside of home ranges. It\nmight not have been because it was pretty, but superior in quality. \n \nAlso, during the Paleo period, bands of hunters traveled very long distances\nthroughout the year and brought with them tool stone that was sourced hundreds\nof miles away from where an artifact might be found. It's not unusual for\nClovis points made of cherts like Coshocton from Ohio, Burlington from the\nMidwest, and Knife River from the Dakotas to be found in Tennessee.\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Re: Did Indians favor Pretty?","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/78E7DA3A220272C37A133A864F983857F4DB9AC7"},{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"3709693"},"a":"Post","dateCreated":"2014-07-14T13:29:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Franklin TN","featureValue":"Franklin TN"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"catman529","featureValue":"catman529"},"uri":"http://dig.isi.edu/atf/data/post/BBAEFA8DC3FBCBB378A46FEECDB38AA6488E4367/featurecollection"},"hasBodyPart":{"text":"\n\nthey definitely made some pretty stuff, from what I have seen, not just\nstrictly functional. But all of it was functional. I don't really know the\nhistory though.\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Re: Did Indians favor Pretty?","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/BBAEFA8DC3FBCBB378A46FEECDB38AA6488E4367"}],"hasTitlePart":{"text":"Did Indians favor Pretty?","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/thread/D07FF4C80EE99F27C3EE2078F073A7780FB76379"}
