{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-thread-context.json","hasIdentifier":{"a":"Identifier","label":"45843"},"a":"Thread","hasPost":{"@context":"https://raw.githubusercontent.com/usc-isi-i2/dig-alignment/atf/datasets/atf/j28json/j28-post-context.json","hasIdentifier":{"a":"Identifier","label":"573754"},"a":"Post","dateCreated":"2013-01-10T09:05:00","hasFeatureCollection":{"place_postalAddress_feature":{"featureName":"place_postalAddress","a":"Feature","place_postalAddress":"Staunton, VA, USA","featureValue":"Staunton, VA, USA"},"a":"FeatureCollection","person_username_feature":{"featureName":"person_username","a":"Feature","person_username":"Hobie","featureValue":"Hobie"},"uri":"http://dig.isi.edu/atf/data/post/E7ED904047963E52BB553F71AE6B1DBBCF01ADB7/featurecollection"},"hasBodyPart":{"text":"\n\nGentlemen, \n \nWe shooters are being attacked and many of you are expressing your distaste\nfor that and otherwise discussing politics at a level equal to or exceeding\nthat before the election. However, you are forgetting to post in the politics\nforum. So, we're going to institute the same rule that applies in the\nClassifieds. If the post is in the wrong forum it is likely to disappear.\n\n \n_________________ \nSincerely, \n \nHobie \n \n\"We are all travelers in the wilderness of this world, and the best that we\nfind in our travels is an honest friend.\" Robert Louis Stevenson \n[![Image](http://i29.photobucket.com/albums/c288/TheRealHobie/Web%20Page%20Des\nign/HobieLogo1-1.jpg)](http://shootingwithhobie.blogspot.com/)\n\n","a":"WebPageElement"},"hasTitlePart":{"text":"Posting of Politically Oriented Topics","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/post/E7ED904047963E52BB553F71AE6B1DBBCF01ADB7"},"hasTitlePart":{"text":"Posting of Politically Oriented Topics","a":"WebPageElement"},"uri":"http://dig.isi.edu/atf/data/thread/F69E9D0E8250DCFF2A5F3492D20D2EE3E528335A"}
